import React from 'react';
import { ThemeProvider } from './hooks/useTheme';
import './styles/globals.css';

function App() {
    return (
        <ThemeProvider>
            <div className="App">
                <h1>Test with Theme</h1>
            </div>
        </ThemeProvider>
    );
}

export default App;
